    "2015-12-16T06:04:28.062754",nt"name": "jpeg-formatted-images-of-edgetech-sb-512i-edgetech-sb-424-and-knudsen-3200-chirp-seismic-reflec",nt"isopen":
    false,nt"url": null,nt"notes": "These data were collected under a cooperative
    agreement with the Massachusetts Office of Coastal Zone Management (CZM) and the
    U.S. Geological Survey (USGS), Coastal and Marine Geology Program, Woods Hole Science
    Center (WHSC). Initiated in 2003, the primary objective of this program is to develop
    regional geologic framework information for the management of coastal and marine
    resources. Accurate data and maps of sea-floor geology are important first steps
    toward protecting fish habitat, delineating marine resources, and assessing environmental
    changes due to natural or human impacts. The project is focused on the inshore waters
    of Massachusetts, primarily in depths between 3 and 30 meters. Data collected for
    the mapping cooperative have been released in a series of USGS Open-File Reports
    (http://woodshole.er.usgs.gov/project-pages/coastal_mass/html/current_map.html).
    This spatial dataset is from the study area located in northern Cape Cod Bay, and
    consists of high-resolution geophysics (bathymetry, backscatter intensity, and seismic
    reflection) and ground validation (sediment samples, video tracklines, and bottom
    photographs). The data were collected during five separate surveys conducted between
    2003 and 2008 (USGS-WHSC surveys 06012 in 2006; 07001, 07002, and 07003 in 2007;
    and 08002 in 2008) and cover more than 480 square kilometers of the inner continental
    shelf. For more information on the seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2006-012-FA
    , http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2007-00-FA ,
    http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2007-002-FA , http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2007-003-FA
    , and http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2008-002-FA
    These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
    Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
    applications.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
